import React, {Component, Fragment} from 'react';
import {Button, Col, Container, Row} from "react-bootstrap";

class NavMenuMobile extends Component {
    render() {
        return (
            <Fragment>
                <Container fluid={true} className="p-2 fixed-top bg-light shadow-sm mb-3">
                    <Row>
                        <Col className="p-1" lg={4} md={4} sm={12} xs={12}>

                            <Button className="cart-btn"><i className="fa fa-shopping-cart"></i><i className="fa fa-bars"></i></Button>
                        </Col>

                        <Col lg={4} md={4} sm={12} xs={12}>
                            <div className="input-group w-100">
                                <a href="btn"><img className="nav-logo" src="/images/logo.jpg"/></a>
                                <button type="button"  className="btn site-btn"><i className="fa fa-search"></i></button>
                            </div>
                        </Col>

                    </Row>
                </Container>


            </Fragment>
        );
    }
}

export default NavMenuMobile;
